INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (166,'010','높은 물에 잠긴 용이 여의주를 얻었으니 어찌 변화가 무궁하지 않겠습니까? 우연히 귀인을 만나 공명을 날리게 되겠습니다. 다만 관재수가 있을 경우 일신이 수고롭고 힘들 수 있습니다. 남의 말을 잘못 믿고 행동하면 도리어 불리하니 사람 사귐에 신중해야 합니다. 재물운이 좋으니 백 가지 일마다 이루어지지 않는 것이 없겠습니다. 귀인이 항상 도와주니 무엇이 성공을 방해하겠습니까? 좋은 비가 때를 기다렸다가 내리니 금년은 필시 풍년을 기약하는 것과 같습니다. 문을 나가면 크게 길하고 의외로 재물을 얻을 것입니다. 새처럼 날개를 펴고 비상한다면 천리인들 날지 못하겠습니까? 남쪽과 동쪽 방향이 특히 길하니 그 방위에서 기회를 찾으십시오. 올해는 전반적으로 발전과 성장의 해이니 적극적으로 움직이되, 건강 면에서는 간과 눈에 특히 유의하고 충분한 휴식을 취하십시오.','하늘과 땅이 서로 응하니 만물이 앞을 다투어 생동합니다. 정월과 이월에는 복이 찾아와 서로 호응할 것입니다. 귀인이 항상 곁에 있어 어려운 일을 지켜보다가 우연히 나를 도와줄 것이니 필시 성사되겠습니다. 동쪽 방향이 길하고, 호흡기 건강에 유의하십시오.','일이 신속히 이루어지니 이익이 쌓이겠습니다. 돌아가는 기러기가 때를 지어 날아가듯 천리 길을 갈 수 있습니다. 만약 명성을 얻지 못하더라도 자손으로 인한 경사나 가족이 늘어나는 기쁨이 있겠습니다. 남쪽 방향이 길하고, 소화기 건강에 신경 쓰십시오.','집안의 일이 흥왕하고 가족과 재산이 늘어나 운이 점점 좋아지겠습니다. 경영하는 일은 다른 사람이 먼저 시작할 수 있으니 주저하다가는 선두를 빼앗기겠습니다. 과감하게 행동하십시오. 동남쪽이 길하고, 심장과 혈압에 유의하십시오.','흉한 기운이 문을 엿보고 있으니 뒤를 조심하십시오. 도둑을 조심하지 않으면 물건을 잃은 뒤에야 크게 후회하게 됩니다. 북방은 불길하니 출행하지 마십시오. 하던 일을 중단하려 하면 도리어 해가 됩니다. 서쪽이 무난하고, 신경계 건강에 유의하십시오.','비록 일을 도모하려 하지만 그 일로 인해 다른 사람이 해코지할 수 있습니다. 서쪽 사람을 가까이하지 마십시오. 일을 마무리하려고 서두르는 자가 해롭습니다. 사람을 잘못 사귀면 반드시 손재를 겪게 됩니다. 북동쪽이 무난하고, 관절과 허리에 신경 쓰십시오.','이익이 남방에 있으니 마땅히 남쪽으로 가십시오. 일을 성대하게 추진하면 이익이 있으니 어찌 망설이겠습니까? 백 가지 일마다 이룸이 있으니 사람들이 우러러 보겠습니다. 그러나 무리하면 해가 있으니 분수 밖의 것을 탐하지 마십시오. 남쪽이 길하고, 폐와 기관지에 유의하십시오.','시비를 가까이하지 마십시오. 재물을 잃게 됩니다. 처리가 당연하다면 다른 사람들이 말하지 못합니다. 후회가 없다면 가정에 경사가 있을 것이니 시비에 빠지지 말고 처리를 분명히 하십시오. 북쪽이 무난하고, 위장 건강에 유의하십시오.','시비를 벌이면 관재수를 면치 어려우니 멀리 해야 합니다. 이익이 멀리서 오니 나아가면 재물을 얻겠으나 조급하게 서두르지 말고 멀리 내다보십시오. 명성이 사방에 떨치니 사람들이 흠모하게 됩니다. 동쪽이 길하고, 귀와 청력에 신경 쓰십시오.','머리에 월계관을 쓰니 마침내 성공입니다. 궁지에 몰렸다가 마침내 살 길을 만난 것과 같으니 흉함 가운데서도 길함을 보게 됩니다. 소인에게는 불길하고 대인에게는 크게 길한 운이니 감당하기 어려운 때는 삼가십시오. 남동쪽이 길하고, 두통과 어지럼증에 유의하십시오.','길성이 비추니 집안에 경사가 있겠습니다. 이익은 필시 남쪽과 북쪽에 있습니다. 일을 성대하게 추진하고 마무리를 잘해야 합니다. 귀인의 도움이 있다면 뜻밖의 재물을 얻게 됩니다. 남북 방향이 길하고, 피부 건강에 신경 쓰십시오.','기쁜 일이 몸에 임하게 됩니다. 비록 마음에 들지 않는 일이 있어도 도리어 길하게 풀릴 것이니 염려하지 마십시오. 명성이 멀리까지 퍼지고 모든 일이 쉽게 성사되니 무엇을 걱정하겠습니까? 동쪽이 길하고, 치아와 잇몸에 유의하십시오.','사람으로 인하여 해를 입을 수 있으며 그 손재가 클 수 있습니다. 사람을 잘못 사귀면 반드시 재물에 해가 됩니다. 이러한 점에만 조심한다면 태평하니 편안하게 지낼 수 있겠습니다. 서쪽이 무난하고, 신장과 방광에 유의하십시오.','2025-03-02 03:02:00.942065+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (308,'010','A dragon submerged in deep waters has obtained the wish-fulfilling jewel—how could transformations not be limitless? You will unexpectedly meet a benefactor and achieve fame. However, if legal troubles arise, your body may suffer hardship. Acting on others'' words without discernment will be disadvantageous, so be cautious in relationships. Fortune in wealth is excellent, so nothing you undertake will fail to be accomplished. With benefactors always helping, what could obstruct your success? Good rain falls when the time is right, promising an abundant harvest this year. Going outside brings great fortune and unexpected wealth. If you spread your wings and soar like a bird, could even a thousand miles stop you? South and east directions are especially auspicious—seek opportunities there. This year is generally one of development and growth, so move actively. For health, pay special attention to your liver and eyes, and get sufficient rest.','Heaven and earth respond to each other, and all things vie to come alive. Blessings will arrive in the first and second months, responding to each other. A benefactor is always nearby, watching over difficulties and unexpectedly helping you succeed. The east is auspicious; mind your respiratory health.','Matters will be accomplished swiftly, and profits will accumulate. Like returning geese flying in formation, you can travel a thousand miles. Even if you don''t gain fame, there will be celebrations through offspring or the joy of family expansion. The south is auspicious; mind your digestive health.','Household affairs flourish, and as family and assets increase, fortune improves steadily. In business, others may start first, so hesitation means losing the lead. Act decisively. The southeast is auspicious; mind your heart and blood pressure.','Malevolent energy peers at your door, so watch your back. If you don''t guard against thieves, you will greatly regret after losing possessions. The north is inauspicious—do not travel there. Abandoning current work will bring harm instead. The west is manageable; mind your nervous system.','Though you plan to conduct business, others may try to harm you because of it. Do not associate with people from the west. Those who rush to finish work are harmful. Wrong associations will surely lead to financial loss. The northeast is manageable; mind your joints and back.','Profit lies in the south, so go south accordingly. Promoting matters grandly brings profit—why hesitate? Every endeavor bears fruit, and people will look up to you. However, overreaching brings harm, so do not covet what is beyond your lot. The south is auspicious; mind your lungs and bronchi.','Stay away from disputes—you will lose wealth. If your handling is proper, others cannot criticize. If there is no regret, your home will have celebrations. Avoid disputes and handle matters clearly. The north is manageable; mind your stomach health.','Engaging in disputes makes legal troubles hard to avoid—keep distance. Profit comes from afar; advancing brings wealth, but do not rush hastily—look far ahead. Your fame spreads in all directions, earning admiration. The east is auspicious; mind your ears and hearing.','Wearing a laurel crown means final success. Like finding a way out when cornered—even amid misfortune, you will see good fortune. This luck is inauspicious for petty people but greatly auspicious for noble persons. Be cautious in overwhelming times. The southeast is auspicious; mind headaches and dizziness.','Auspicious stars shine, bringing celebrations to your household. Profit surely lies in the south and north. Promote matters grandly and finish them well. With a benefactor''s help, you will gain unexpected wealth. North-south directions are auspicious; mind your skin health.','Joyful events will come to you. Even if something displeases you, it will turn out well—do not worry. Your fame spreads far, and all matters succeed easily—what is there to worry about? The east is auspicious; mind your teeth and gums.','Harm may come through people, and the loss could be significant. Wrong associations will surely harm your wealth. Being careful only about this point brings peace and comfort. The west is manageable; mind your kidneys and bladder.','2025-03-02 03:02:00.942065+00','e');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (450,'010','深い水に沈んだ龍が如意宝珠を得たのですから、どうして変化が無限でないでしょうか？偶然に貴人と出会い、名声を轟かせることになります。ただし、訴訟沙汰がある場合は、体が苦労し大変かもしれません。他人の言葉を誤って信じて行動すれば却って不利になるので、人付き合いには慎重であるべきです。財運が良いので、百のことすべてが成就しないことはないでしょう。貴人が常に助けてくれるのに、何が成功を妨げるでしょうか？良い雨が時を待って降るので、今年は必ず豊作を約束するようなものです。門を出れば大いに吉で、思いがけず財物を得るでしょう。鳥のように翼を広げて飛翔すれば、千里でも飛べないことがあるでしょうか？南と東の方角が特に吉なので、その方位で機会を探してください。今年は全般的に発展と成長の年なので、積極的に動きつつも、健康面では特に肝臓と目に気を付け、十分な休息を取ってください。','天と地が互いに応じ、万物が先を争って生き生きとします。正月と二月には福が訪れ、互いに呼応するでしょう。貴人が常にそばにいて、困難なことを見守りながら偶然私を助けてくれるので、必ず成功します。東が吉です。呼吸器の健康に気を付けてください。','物事が速やかに成就するので、利益が積み重なります。帰る雁が群れをなして飛ぶように、千里の道を行くことができます。たとえ名声を得られなくても、子孫による慶事や家族が増える喜びがあるでしょう。南が吉です。消化器の健康に気を付けてください。','家の仕事が繁盛し、家族と財産が増えて運がますます良くなります。経営することは他の人が先に始めるかもしれないので、躊躇していると先頭を奪われます。果敢に行動してください。東南が吉です。心臓と血圧に気を付けてください。','凶悪な気が門を覗いているので、後ろに気を付けてください。泥棒に注意しなければ、物を失った後で大いに後悔することになります。北方は不吉なので出かけないでください。やっている仕事を中断しようとすると却って害になります。西が無難です。神経系の健康に気を付けてください。','仕事を図ろうとしても、その仕事のせいで他の人が害しようとするかもしれません。西の人に近づかないでください。仕事を終わらせようと急ぐ者は害があります。人を間違って付き合えば必ず損財を経験します。北東が無難です。関節と腰に気を付けてください。','利益が南方にあるので、当然南へ行ってください。仕事を盛大に推進すれば利益があるのに、どうしてためらうでしょうか？百のことすべてに成果があるので、人々が仰ぎ見るでしょう。しかし、無理をすれば害があるので、分を超えたものを求めないでください。南が吉です。肺と気管支に気を付けてください。','是非に近づかないでください。財物を失うことになります。処理が当然であれば、他の人は何も言えません。後悔がなければ家庭に慶事があるので、是非に巻き込まれず、処理を明確にしてください。北が無難です。胃の健康に気を付けてください。','是非を起こせば訴訟沙汰を免れ難いので、遠ざけるべきです。利益は遠くから来るので、進めば財物を得られますが、焦って急がず、遠くを見てください。名声が四方に轟き、人々が慕います。東が吉です。耳と聴力に気を付けてください。','頭に月桂冠を被れば、ついに成功です。窮地に追い込まれてついに活路を見出したようなもので、凶の中にも吉を見ることになります。小人には不吉で、大人には大いに吉な運なので、対処しがたい時は慎んでください。東南が吉です。頭痛とめまいに気を付けてください。','吉星が照らすので、家に慶事があるでしょう。利益は必ず南と北にあります。仕事を盛大に推進し、仕上げをよくしなければなりません。貴人の助けがあれば思いがけない財物を得るでしょう。南北の方角が吉です。肌の健康に気を付けてください。','喜ばしいことが身に起こります。たとえ気に入らないことがあっても、却って吉に転じるので心配しないでください。名声が遠くまで広がり、すべての事が簡単に成就するのに、何を心配するでしょうか？東が吉です。歯と歯茎に気を付けてください。','人によって害を受ける可能性があり、その損失は大きいかもしれません。人を間違って付き合えば必ず財物に害が及びます。この点にだけ気を付ければ太平で、安らかに過ごせるでしょう。西が無難です。腎臓と膀胱に気を付けてください。','2025-03-02 03:02:00.942065+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (379,'010','深水中的龙得到了如意宝珠，变化怎能不是无穷无尽？偶然遇到贵人，将会扬名立万。但如果有官司，身体可能会辛苦劳累。错信他人的话而行动会反而不利，所以交友要谨慎。财运很好，百事无不成就。贵人总是帮助你，什么能阻碍成功呢？好雨等待时机降下，今年必定丰收。出门大吉，会意外获得财物。像鸟一样展翅高飞，千里又何妨？南方和东方特别吉利，在那些方位寻找机会吧。今年总体是发展和成长之年，积极行动的同时，健康方面要特别注意肝脏和眼睛，充分休息。','天地相应，万物争相生动。正月和二月福气到来，相互呼应。贵人总在身边，看着困难的事情偶然帮助我，必定成功。东方吉利，注意呼吸系统健康。','事情迅速完成，利润积累。像归雁成群飞翔，可以行千里路。即使不能扬名，也会有子孙带来的喜事或家人增多的喜悦。南方吉利，注意消化系统健康。','家中事务兴旺，家人和财产增加，运气越来越好。经营的事可能被别人抢先，犹豫就会失去先机。果断行动吧。东南方吉利，注意心脏和血压。','凶气在窥探门户，要小心背后。如果不防备小偷，失去东西后会大大后悔。北方不吉，不要出行。想要中断正在做的事反而会有害。西方尚可，注意神经系统健康。','虽然想做事，但可能因此被人陷害。不要接近西方的人。急于完成工作的人有害。交友不慎必定遭受损失。东北方尚可，注意关节和腰部。','利在南方，应当向南走。大举推进事业有利，何必犹豫？百事皆有成果，人们会仰望你。但过度勉强会有害，不要贪图分外之物。南方吉利，注意肺和支气管。','远离是非，否则会失去财物。如果处理得当，别人无话可说。没有遗憾的话，家中会有喜事，不要陷入是非，处理要明确。北方尚可，注意胃部健康。','挑起是非难免官司，要远离。利从远方来，前进会得财，但不要急躁，要看长远。名声四方传扬，人们会仰慕。东方吉利，注意耳朵和听力。','头戴桂冠，终于成功。如同走投无路时找到活路，凶中也能见吉。对小人不吉，对大人大吉，难以应付时要谨慎。东南方吉利，注意头痛和头晕。','吉星照耀，家中有喜事。利润必在南方和北方。要大力推进事业并收好尾。如果有贵人帮助，会得到意外之财。南北方向吉利，注意皮肤健康。','喜事临身。即使有不如意的事，也会转为吉祥，不必担心。名声远扬，百事轻易成功，有什么好担心的？东方吉利，注意牙齿和牙龈。','可能因人受害，损失可能很大。交友不慎必定伤害财物。只要小心这一点，就能太平安逸。西方尚可，注意肾脏和膀胱。','2025-03-02 03:02:00.942065+00','c');
